<link rel="stylesheet" href="path-to-the-file/splide.min.css"></link>



const ProductList = () => {

    const {products} = useContext(ProductContext);

    return (
        
        <Splide>
        <SplideSlide>
          <img src="../assets/css/img/logo.png" alt="logo"/>
        </SplideSlide>
        <SplideSlide>
          <img src="../assets/css/img/outdoor.jpg" alt="outdoor"/>
        </SplideSlide>
      </Splide>
    )
}

export default ProductList
